description:
Verenigde Staten 
Drama / Komedie 
113 minuten 

geregisseerd door Garry Marshall 
met Jane Fonda, Lindsay Lohan en Felicity Huffman 

Rachel (Lindsay Lohan) is een rebelse tiener, die door haar labiele moeder (Felicity Huffman) wordt gedwongen om de zomer bij haar grootmoeder (Jane Fonda) door te brengen. De reis die Rachel moet maken en het verblijf bij haar oma, zorgen ervoor dat zij geestelijk sterker en volwassener wordt. 

